import React from 'react'
import { Pie, PieChart, Tooltip } from 'recharts'
import Gender from './Gender';
function Barchart() {
   
  {
    const data = [
      {name: "Male",value:10},
      {name:"Female",value:15},
      {name:"Required",value:3},
    ];
    return(
      <div className='chart'>
    <h1>Genderchart</h1>
    <div style={{width:'50%',height:'50%',padding:'20px'}}>
    <PieChart width={500} height={600}id='piechart' >
    <Pie 
    dataKey="value"
    data={data}
    cx={100}
    cy={150}
    innerRadius={50}
    outerRadius={100}
    fill='orange'
    />
    <Tooltip/>
    </PieChart></div>
      </div>
    )
  }
}


export default Barchart
